import React from 'react';
import PropTypes from 'prop-types';

export const Checkout = ({itemCount}) => (
      <div className="container container-fluid ">
        <div className="row justify-content-end">
          <span className="card-text">Item Count: {itemCount}</span>
          <button type="button" className="btn btn-primary mr-2" >Checkout</button>
        </div>
      </div>
);

Checkout.propTypes = {
  itemCount: PropTypes.string.isRequired
}
